import { Flex, HStack, Text } from "@chakra-ui/react";

const Navbar = () => {
    return (
        <Flex w='100vw' h='90px' bg='blue.600' justifyContent='center' alignItems='center'>
            <HStack w='90%' just>
                <Text>SocialHub</Text>
                <HStack>
                    <Text>Profile</Text>
                </HStack>
            </HStack>
        </Flex>
    )
}

export default Navbar;
